# https://leetcode.cn/problems/last-substring-in-lexicographical-order/submissions/


from time import time
  
  
def timer_func(func):
    # This function shows the execution time of 
    # the function object passed
    def wrap_func(*args, **kwargs):
        t1 = time()
        result = func(*args, **kwargs)
        t2 = time()
        print(f'Function {func.__name__!r} executed in {(t2-t1):.4f}s')
        return result
    return wrap_func

# will work
class Solution:
    @timer_func
    def lastSubstring(self, s: str) -> str:
        return max(s[i:] for i in range(len(s)))

# will time out 
class Solution2:
    @timer_func
    def lastSubstring2(self, s: str) -> str:
        return max([s[i:] for i in range(len(s))])


s1 = ""

Solution().lastSubstring(s1)
Solution2().lastSubstring2(s1)